import './App.css';
import Background from "./components/Background";
import CurrentTime from "./components/Clock";
import Dhikr from "./components/Dhikr";
import NamazTimes from "./components/NamazTimes";
import Quiz from "./components/Quiz";
import Search from "./components/Search";
import Shortcuts from "./components/Shortcuts";



function App() {
  return (

<div className= "main">
<div className= "left-clock">
<div className= "left-clock-holder">
<NamazTimes/>
<CurrentTime/>
</div>
</div>
<div className= "mid-search">
<Dhikr/>
<Search/>
<Shortcuts/>
<Background/>
</div>
<Quiz/>
</div>
  );
}


export default App;
